; ---------------------------------------------------------------
; void __near__ GameLoop (void)
; ---------------------------------------------------------------

.segment	"CODE"

.proc	_GameLoop: near

.segment	"CODE"

;
; ppu_off(); 
;
	jsr     _ppu_off
;
; oam_clear();
;
	jsr     _oam_clear
;
; pal_bg(palette);
;
	lda     #<(_palette)
	ldx     #>(_palette)
	jsr     _pal_bg
;
; pal_spr((const char*)spritePalette);
;
	lda     #<(_spritePalette)
	ldx     #>(_spritePalette)
	jsr     _pal_spr
;
; switch(currentLevel)
;
	lda     _currentLevel
	ldx     _currentLevel+1
;
; }
;
	cpx     #$00
	bne     L0003
	cmp     #$01
	beq     L0004
	cmp     #$02
	beq     L0005
	cmp     #$03
	beq     L0006
	jmp     L0003
;
; currentLevelData = Level1;
;
L0004:	lda     #>(_Level1)
	sta     _currentLevelData+1
	lda     #<(_Level1)
	sta     _currentLevelData
;
; player.deathCounter = 0;
;
	txa
	sta     _player+23
	sta     _player+23+1
;
; ChangeMusic(4);
;
	lda     #$04
;
; break;
;
	jmp     L0007
;
; currentLevelData = Level2;
;
L0005:	lda     #>(_Level2)
	sta     _currentLevelData+1
	lda     #<(_Level2)
	sta     _currentLevelData
;
; ChangeMusic(1);
;
	lda     #$01
;
; break;
;
	jmp     L0007
;
; currentLevelData = Level3;
;
L0006:	lda     #>(_Level3)
	sta     _currentLevelData+1
	lda     #<(_Level3)
	sta     _currentLevelData
;
; ChangeMusic(0);
;
	txa
L0007:	jsr     _ChangeMusic
;
; vram_adr(NAMETABLE_A);      
;
L0003:	ldx     #$20
	lda     #$00
	jsr     _vram_adr
;
; vram_fill(0x00, 1024);
;
	lda     #$00
	jsr     pusha
	ldx     #$04
	jsr     _vram_fill
;
; vram_adr(NAMETABLE_A);      
;
	ldx     #$20
	lda     #$00
	jsr     _vram_adr
;
; vram_write(LoadingScreen, 1024);
;
	lda     #<(_LoadingScreen)
	ldx     #>(_LoadingScreen)
	jsr     pushax
	ldx     #$04
	lda     #$00
	jsr     _vram_write
;
; vram_adr(NTADR_A(11, 16));
;
	ldx     #$22
	lda     #$0B
	jsr     _vram_adr
;
; vram_write(loadingText, sizeof(loadingText) - 1); 
;
	lda     #<(_loadingText)
	ldx     #>(_loadingText)
	jsr     pushax
	ldx     #$00
	lda     #$0A
	jsr     _vram_write
;
; ppu_on_all();
;
	jsr     _ppu_on_all
;
; delay(60);
;
	lda     #$3C
	jsr     _delay
;
; ppu_off();
;
	jsr     _ppu_off
;
; vram_adr(NAMETABLE_A);      
;
	ldx     #$20
	lda     #$00
	jsr     _vram_adr
;
; vram_write(currentLevelData, 1024);
;
	lda     _currentLevelData
	ldx     _currentLevelData+1
	jsr     pushax
	ldx     #$04
	lda     #$00
	jsr     _vram_write
;
; WriteDeathCounter();
;
	jsr     _WriteDeathCounter
;
; ppu_on_all();
;
	jmp     _ppu_on_all

.endproc

