.segment	"CODE"

.proc	_MovePlayer: near

.segment	"CODE"

;
; if (inputPad & PAD_A && !player.isDashing) 
;
	lda     _inputPad
	and     #$80
	beq     L0002
	lda     _player+16
	ora     _player+16+1
	bne     L0002
;
; player.jumpBufferTimer = JUMP_BUFFER_FRAMES;
;
	lda     #$0A
	sta     _player+15
;
; if (OnGround()) 
;
L0002:	jsr     _OnGround
	tax
	beq     L005F
;
; player.coyoteTime = COYOTE_FRAMES;
;
	lda     #$0A
	sta     _player+2
;
; player.hasDashedInAir = 0;
;
	lda     #$00
	sta     _player+20
;
; else if (player.coyoteTime > 0) 
;
	jmp     L0060
L005F:	lda     _player+2
	beq     L0060
;
; player.coyoteTime--;
;
	dec     _player+2
;
; if (movementPad & PAD_LEFT)
;
L0060:	lda     _movementPad
	and     #$02
	beq     L0061
;
; if (!CheckIfCollidableTile(currentLevelData[GetTileIndex(player.left, player.y + 1)]))
;
	lda     _currentLevelData
	ldx     _currentLevelData+1
	jsr     pushax
	lda     _player+3
	jsr     pusha
	lda     _player+1
	clc
	adc     #$01
	jsr     _GetTileIndex
	jsr     tosaddax
	sta     ptr1
	stx     ptr1+1
	ldy     #$00
	lda     (ptr1),y
	jsr     _CheckIfCollidableTile
	tax
	bne     L0061
;
; player.x -= PLAYER_SPEED;
;
	lda     _player
	sec
	sbc     #$02
	sta     _player
;
; player.facingRight = 0;
;
	stx     _player+11
;
; if (movementPad & PAD_RIGHT)
;
L0061:	lda     _movementPad
	and     #$01
	beq     L0062
;
; if (!CheckIfCollidableTile(currentLevelData[GetTileIndex(player.right, player.y + 1)]))
;
	lda     _currentLevelData
