;
	jsr     _OnGround
	tax
	bne     L0066
	lda     _player+20
	bne     L006A
;
; player.dashDirection = (movementPad & PAD_LEFT ? -1 : movementPad & PAD_RIGHT ? 1 : 0);
;
L0066:	lda     _movementPad
	and     #$02
	beq     L0067
	ldx     #$FF
	txa
	jmp     L0019
L0067:	lda     _movementPad
	ldx     #$00
	and     #$01
	beq     L0019
	lda     #$01
L0019:	sta     _player+21
	stx     _player+21+1
;
; player.isDashing = 1;
;
	ldx     #$00
	lda     #$01
	sta     _player+16
	stx     _player+16+1
;
; player.dashTimer = DASH_DURATION;
;
	lda     #$06
	sta     _player+18
;
; if (!OnGround())
;
	jsr     _OnGround
	tax
	bne     L006A
;
; player.hasDashedInAir = 1;
;
	lda     #$01
	sta     _player+20
;
; else if (player.dashCooldown > 0) 
;
	jmp     L006A
L0069:	lda     _player+19
	beq     L006A
;
; player.dashCooldown--;
;
	dec     _player+19
;
; if (player.jumpBufferTimer > 0 && !player.isJumping && player.coyoteTime > 0) 
;
L006A:	lda     _player+15
	beq     L006E
	lda     _player+14
	bne     L006E
